	@Test
	public void validateChekDigit_sit_Ok_N() {
		boolean checkDigit = true;

		for (int i = 0; i < VALID_EC_NUMBER_MAESTRO_SIT_ARRAY.length; i++) {
			try {
				assertTrue(ECValidator.validate(VALID_EC_NUMBER_MAESTRO_SIT_ARRAY[i], checkDigit));
			} catch (AssertionError e) {
				System.out.println(i + ":" + VALID_EC_NUMBER_MAESTRO_SIT_ARRAY[i]);
				throw e;
			} catch (ParseException e) {
				System.out.println(i + ":" + VALID_EC_NUMBER_MAESTRO_SIT_ARRAY[i]);
				throw new AssertionError(e);
			}
		}
		System.out.println("Total Maestros SIT ok:" + VALID_EC_NUMBER_MAESTRO_SIT_ARRAY.length);
	}

	@Test
	public void validateChekDigit_sit_NOk_N() throws ParseException {
		boolean checkDigit = true;
		for (int i = 0; i < VALID_EC_NUMBER_MAESTRO_SIT_ARRAY.length; i++) {
			try {
				assertFalse(ECValidator.validate(changeDigitContol(VALID_EC_NUMBER_MAESTRO_SIT_ARRAY[i]), checkDigit));
			} catch (AssertionError e) {
				System.out.println(i + ":" + VALID_EC_NUMBER_MAESTRO_SIT_ARRAY[i]);
				throw new AssertionError(e);
			}
		}
	}

	private static String changeDigitContol(String casNumber) {
		String[] parts = casNumber.split("-");
		int newValue = (new Integer(parts[2]) + 1) % 10;
		return parts[0] + "-" + parts[1] + "-" + newValue;
	}

